tí, přesto výkonný','With the Coupons addon, you can offer customers discounts using custom coupon codes. Create your own percentage or fixed rate discount, then add the Coupon field to any payment form. When a customer enters your unique code, they’ll receive the specified discount. You can also add limits to restrict when coupons are available and how often they can be used. The Coupons addon requires a license level of Pro or higher.%s'=>'S doplňkem Kupóny můžete zákazníkům nabízet slevy pomocí vlastních kódů kuponů. Vytvořte si vlastní procentuální nebo pevnou slevu a poté přidejte pole Kupón do libovolného platebního formuláře. Když zákazník zadá jedinečný kód, obdrží specifikovanou slevu. Můžete také přidat limity, abyste omezili, kdy jsou kupóny dostupné a jak často je lze použít. Doplněk Kupóny vyžaduje úroveň licence Pro nebo vyšší.%s','Coupon Settings'=>'Nastavení kupónu','Coupons Overview'=>'Přehled kupónů','Usage Statistics'=>'Statistiky použití','Start and End Dates'=>'Datum zahájení a ukončení','Percentage or Fixed Discounts'=>'Procentní nebo pevné slevy','Maximum Usage Limit'=>'Maximální limit použití','Custom Coupon Codes'=>'Vlastní kódy kupónů','and'=>'a','%s license'=>'%s licence','%s PHP extension'=>'%s rozšíření PHP' . "\0" . '%s rozšíření PHP' . "\0" . '%s rozšíření PHP','<a href="%s" target="_blank" rel="noopener noreferrer">Read more</a> for additional information.'=>'<a href="%s" target="_blank" rel="noopener noreferrer">Přečtěte si více</a> pro další informace.','No coupons applied during the selected period'=>'Během zvoleného období nebyly použity žádné kupóny','No sales for selected period'=>'Žádné prodeje pro vybrané období','Overview'=>'Souhrn','Last 30 days'=>'Posledních 30 dnů','Last 7 days'=>'Posledních 7 dnů','Unlock conditional logic, coupons, lower Stripe fees, and more. <a href="%s" target="_blank" rel="noopener noreferrer">Upgrade to Pro!</a>'=>'Odemkněte podmíněnou logiku, kupóny, nižší poplatky za Stripe a další. <a href="%s" t