ipe platba zastavena kvůli chybě','Stripe subscription payment stopped by error'=>'Stripe platba za předplatné zastavena kvůli chybě','Stripe subscription payment stopped, customer email not found.'=>'Stripe platba za předplatné zastavena, e-mail zákazníka nebyl nalezen.','Stripe subscription payment stopped, missing form settings.'=>'Stripe platba za předplatné zastavena, chybí nastavení formuláře.','Stripe payment stopped, amount less than minimum charge required.'=>'Stripe platba zastavena, částka je nižší než minimální požadovaný poplatek.','Stripe payment stopped, invalid/empty amount.'=>'Stripe platba zastavena, neplatná/prázdná částka.','Stripe payment stopped, missing payment fields.'=>'Stripe platba zastavena, chybí platební pole.','Stripe payment stopped, missing keys.'=>'Stripe platba zastavena, chybí klíče.','Unable to process payment, please try again later.'=>'Platbu nebylo možné zpracovat, prosím zkuste to znovu později.','Payment Element failed to load. Stripe API responded with the message:'=>'Platební prvek se nepodařilo načíst. Stripe API odpovědělo zprávou:','Please fill out payment details to continue.'=>'Pro pokračování prosím vyplňte platební údaje.','Credit Card field is disabled, Stripe payments are not enabled in the form settings.'=>'Pole Kreditní karta je deaktivováno, platby Stripe nejsou v nastavení formuláře povoleny.','Credit Card field is disabled, Stripe keys are missing.'=>'Pole Kreditní karta je deaktivováno, chybí Stripe klíče.','This page is insecure. Credit Card field should be used for testing purposes only.'=>'Tato stránka je nezabezpečená. Pole Kreditní karta by mělo být použito pouze pro testovací účely.','<p>Stripe Payments must be enabled when using the Stripe Credit Card field.</p><p>To proceed, please go to <strong>Payments » Stripe</strong> and check <strong>Enable Stripe payments</strong>.</p>'=>'<p>Při použití pole Kreditní karta Stripe musí být povoleny platby Stripe.</p><p>Chcete-li pokračovat, přejděte na <strong>Platby » Stripe</strong> a zaškrtněte možnost <strong>Povolit platby Stripe</strong> >.</p>','<p>Stripe account connection is required when using the Stripe Credit Card field.</p><p>To proceed, please go to <strong>WPForms Settings » Payments » Stripe</strong> and press <strong>Connect with Stripe</strong> button.</p>'=>'<p>Při použití pole Kreditní karta Stripe je vyžadováno připojení k účtu Stripe.</p><p>Chcete-li pokračovat, přejděte prosím do <strong>Nastavení WPForms » Platby » Stripe</strong> a stiskněte <strong>Připojit k Stripe</strong>.</p>','<p>AJAX form submissions are required when using the Stripe Credit Card field.</p><p>To proceed, please go to <strong>Settings » General » Advanced</strong> and check <strong>Enable AJAX form submission</strong>.</p>'=>'<p>Při použití pole Stripe Credit Card je vyžadováno odeslání formuláře AJAX.</p><p>Chcete-li pokračovat, přejděte do <strong>Nastavení » Obecné » Pokročilé</strong> a zaškrtněte políčko <strong>Povolit odesílání formuláře AJAX</strong>.</p>','Card number'=>'Číslo karty','Name on Card'=>'Jméno na kartě','Card'=>'Karta','CVC'=>'CVC','Expiration'=>'Expirace','Card Number'=>'Číslo Karty','Floating'=>'Plovoucí','Above'=>'Nad','Stripe subscription stopped. invalid PaymentIntent status.'=>'Stripe platba za předplatné zastavena. Neplatný stav PaymentIntent.','Stripe subscription stopped, missing PaymentMethod id.'=>'Stripe platba za předplatné zastavena, chybí ID PaymentMethod.','Stripe payment stopped. Invalid PaymentIntent status.'=>'Stripe platba zastavena. Neplatný stav PaymentIntent.','Stripe payment stopped, missing PaymentMethod id.'=>'Stripe platba zastavena, chybí ID platební metody.','Stripe payment stopped, missing both PaymentMethod and PaymentIntent ids.'=>'Stripe platba zastavena, chybí ID PaymentMethod i PaymentIntent.','Unable to process payment.'=>'Platbu nebylo možné zpracovat.','Unable to process Stripe payment.'=>'Platbu přes Stripe nebylo možné zpracovat.','Network communication with Stripe failed.'=>'Síťová komunikace se Stripe se nezdařila.','Authentication with Stripe API failed.'=>'Ověření pomocí Stripe API se nezdařilo.','Invalid parameters were supplied to Stripe API.'=>'Do Stripe API byly dodány neplatné parametry.','Too many requests made to the API too quickly.'=>'Příliš mnoho požadavků na rozhraní API příliš rychle.','Please see <a href="%s" target="_blank" rel="noopener noreferrer">our documentation on Stripe Credit Card field modes for full details</a>.'=>'Úplné podrobnosti naleznete v <a href="%s" target="_blank" rel="noopener noreferrer">naší dokumentaci o módech polí kreditních karet Stripe</a>.','Connect with Stripe'=>'Připojit k Stripe','<a href="%s">Switch Accounts</a>'=>'<a href="%s">Přepnout účty</a>','Connected to Stripe as <em>%1$s</em> in <strong>%2$s Mode</strong>.'=>'Připojeno k Stripe jako <em>%1$s</em> v <strong>módu %2$s</strong>.','Easily collect credit card payments with Stripe. For getting started and more information, see our <a href="%s" target="_blank" rel="noopener noreferrer">Stripe documentation</a>.'=>'Snadno sbírejte platby kreditní kartou pomocí Stripe. Chcete-li začít a dozvědět se více, přečtěte si naši <a href="%s" target="_blank" rel="noopener noreferrer">dokumentaci Stripe</a>.','Test Mode'=>'Testovací režim','Connection Status'=>'Stav připojení','<p>Switching test/live modes requires Stripe account reconnection.</p><p>Press the <em>"Connect with Stripe"</em> button after saving the settings to reconnect.</p>'=>'<p>Přepnutí testovacího/živého režimu vyžaduje opětovné připojení účtu Stripe.</p><p>Po uložení nastavení se znovu připojte stisknutím tlačítka <em>Připojit k Stripe</em>.</p>','Stripe is not connected for your current payment mode. Please press the "Connect with Stripe" button to complete this setup.'=>'Pro aktuální platební režim není Stripe připojen. Toto nastavení dokončíte stisknutím tlačítka "Připojit k Stripe".','<strong>Pay-as-you-go Pricing</strong><br> 3%% fee per-transaction + Stripe fees. <a href="%s" target="_blank">Upgrade to Pro</a> to remove additional fees and unlock powerful features.'=>'<strong>Cena s průběžnými platbami</strong><br> Poplatek 3%% za transakci + poplatky Stripe. <a href="%s" target="_blank">Upgradujte na verzi Pro</a>, abyste odstranili další poplatky a odemkli výkonné funkce.','<strong>Pay-as-you-go Pricing</strong><br> 3%% fee per-transaction + Stripe fees. <a href="%s">Renew your license</a> to remove additional fees and unlock powerful features.'=>'<strong>Cena s průběžnými platbami</strong><br> Poplatek 3%% za transakci + poplatky Stripe. <a href="%s">Obnovením licence</a> odstraníte další poplatky a odemknete výkonné funkce.','<strong>Pay-as-you-go Pricing</strong><br>3%% fee per-transaction + Stripe fees. <a href="%s">Activate your license</a> to remove additional fees and unlock powerful features.'=>'<strong>Cena s průběžnými platbami</strong><br> Poplatek 3%% za transakci + poplatky Stripe. <a href="%s">Aktivací licence</a> odstraníte další poplatky a odemknete výkonné funkce.','Select the field that contains the customer\'s email address. This field is required.'=>'Vyberte pole, které obsahuje e-mailovou adresu zákazníka. Toto pole je povinné.','How often you would like the charge to recur.'=>'Jak často chcete, aby se poplatek opakoval.','Yearly'=>'Ročně','Semi-Yearly'=>'Pololetní','Quarterly'=>'Čtvrtletní','Monthly'=>'Měsíčně','Weekly'=>'Týdně','Daily'=>'Denně','Recurring Period'=>'Opakující se období','Enter the subscription name. Eg: Email Newsletter. Subscription period and price are automatically appended. If left empty the form name will be used.'=>'Zadejte název předplatného. Příklad: e-mailový zpravodaj. Doba předplatného a cena jsou automaticky připojeny. Pokud nic nezadáte, použije se název formuláře.','Plan Name'=>'Název plánu','Enable recurring subscription payments'=>'Povolit opakované platby předplatného','Select the field that contains the customer\'s email address. This is optional but recommended.'