platby byly úspěšně nenávratně smazány.' . "\0" . '%d plateb bylo úspěšně nenávratně smazáno.','Additional information'=>'Dodatečné informace','Advanced details'=>'Pokročilé detaily','Number of payments per page:'=>'Počet plateb na stránku:','Last 1 year'=>'Poslední rok','Yesterday'=>'Včera','Today'=>'Dnes','To use all of the features in this template, you\'ll need the %s. Contact your site administrator to install them, then try opening this template again.'=>'Chcete-li použít všechny funkce v této šabloně, budete potřebovat %s. Obraťte se na správce webu, aby je nainstaloval, a poté zkuste tuto šablonu otevřít znovu.','To use all of the features in this template, you\'ll need the %s. Contact your site administrator to install it, then try opening this template again.'=>'Chcete-li použít všechny funkce v této šabloně, budete potřebovat %s. Obraťte se na správce webu, aby ji nainstaloval, a poté zkuste tuto šablonu otevřít znovu.','Thai Baht'=>'Thajský baht','Taiwan New Dollar'=>'Tchajwanský nový dolar','Swiss Franc'=>'Švýcarský frank','Swedish Krona'=>'Švédská koruna','South African Rand'=>'Jihoafrický rand','Singapore Dollar'=>'Singapurský dolar','Russian Ruble'=>'Ruský rubl','Polish Zloty'=>'Polský zlotý','Philippine Peso'=>'Filipínské peso','New Zealand Dollar'=>'Novozélandský dolar','Norwegian Krone'=>'Norská koruna','Mexican Peso'=>'Mexické peso','Malaysian Ringgit'=>'Malajsijský ringgit','Israeli New Sheqel'=>'Izraelský nový šekel','Hungarian Forint'=>'Maďarský forint','Hong Kong Dollar'=>'Hongkongský dolar','Danish Krone'=>'Dánská Koruna','Czech Koruna'=>'Česká Koruna','Canadian Dollar'=>'Kanadský dolar','Brazilian Real'=>'Brazilský real','Australian Dollar'=>'Australský Dolar','Euro'=>'Euro','Pound Sterling'=>'Libra šterlinků','U.S. Dollar'=>'Americký dolar','items'=>'položky','Dynamic choices'=>'Dynamické možnosti','Accept payments using Stripe only'=>'Přijímejte platby pouze pomocí Stripe','Limited Payment Forms'=>'Omezené platební formuláře','Access to all Standard, Fancy, and Payment Fields'=>'Přístup ke všem standardním, ozdobným a platebním polím','Name, Email, Single Line Text, Paragraph Text, Dropdown, Multiple Choice, Checkboxes, Numbers, Number Slider, and Payment Fields (Single Item, Total, etc.)'=>'Jméno, e-mail, jednořádkový text, odstavcový text, rozevírací seznam, více možností, zaškrtávací políčka, čísla, posuvník čísel a platební pole (jedna položka, celkem atd.)','Standard and Payment Fields'=>'Standardní a Platební pole','terms'=>'podmínky','posts'=>'příspěvky','Are you sure you want to delete this payment and all its information (details, notes, etc.)?'=>'Opravdu chcete smazat tuto platbu všechny její informace (podrobnosti, poznámky, atd.)?','Dismiss this notice'=>'Zavřít toto oznámení','Solve common email deliverability issues for good. <a href="%1$s" target="%2$s" rel="noopener noreferrer">Get WP Mail SMTP!</a>'=>'Vyřešte nadobro běžné problémy s doručováním e-mailů. <a href="%1$s" target="%2$s" rel="noopener noreferrer">Získejte WP Mail SMTP!</a>','Make Sure Important Emails Reach Your Customers'=>'Zajistěte, aby se důležité e-maily dostaly k Vašim zákazníkům','You\'ve already created a form, now add it to the page so your customers can get in touch.'=>'Již jste vytvořili formulář, nyní jej přidejte na stránku, aby vás vaši zákazníci mohli kontaktovat.','Did you know that with <a href="%1$s" target="_blank" rel="noopener noreferrer">WPForms</a>, you can create an easy-to-use contact form in a matter of minutes?'=>'Věděli jste, že pomocí <a href="%1$s" target="_blank" rel="noopener noreferrer">WPForms</a> můžete vytvořit snadno použitelný kontaktní formulář během několika minut?','Don\'t forget to embed your contact form. Simply click the Add Form button below.'=>'Nezapomeňte vložit svůj kontaktní formulář. Jednoduše klikněte na tlačítko Přidat formulář níže.','Then click on the WPForms block to embed your desired contact form.'=>'Poté klikněte na blok WPForms a vložte požadovaný kontaktní formulář.','Embed your form'=>'Vložit svůj formulář','Easily add your contact form'=>'Jednoduše přidejte kontaktní formulář','Get Started'=>'Začít','Notifications can only use 1 From Email. Please do not enter multiple addresses.'=>'Oznámení mohou používat pouze e-mail od 1 odesílatele. Nezadávejte prosím více adres.','Please enter a valid email address. Your notifications won\'t be sent if the field is not filled in correctly.'=>'Zadejte prosím platnou emailovou adresu. Pokud pole není správně vyplněno, oznámení nebudou odeslána.','If you\'ve copied style settings from another form, you can paste them here to add the same styling to this form. Any current style settings will be overwritten.'=>'Pokud jste zkopírovali nastavení stylu z jiného formuláře, můžete je vložit sem a přidat stejný styl do tohoto formuláře. Všechna aktuální nastavení stylu budou přepsána.','There was an error parsing your JSON code. Please check your code and try again.'=>'Při analýze vašeho kódu JSON došlo k chybě. Zkontrolujte prosím kód a zkuste to znovu.','Copy / Paste Style Settings'=>'Kopírovat / Vložit nastavení stylu','Are you sure you want to reset the style settings for this form? All your current styling will be removed and canʼt be recovered.'=>'Opravdu chcete obnovit nastavení stylu pro tento formulář? Všechny aktuální styly budou odstraněny a nebude možné je obnovit.','Reset Style Settings'=>'Resetovat nastavení stylu','Error Message'=>'Chybová zpráva','Colors'=>'Barvy','Border Radius'=>'Poloměr ohraničení','Border'=>'Ohraničení','Background'=>'Pozadí','Size'=>'Velikost','Enable modern markup in your WPForms settings to unlock the controls below.'=>'Chcete-li odemknout níže uvedené ovládací prvky, povolte v nastavení WPForms moderní značkování.','Update WordPress to the latest version to use our modern markup and unlock the controls below.'=>'Aktualizovat WordPress na nejnovější verzi, abyste mohli používat naše moderní značení a odemknout ovládací prvky níže.','Want to customize your form styles without editing CSS?'=>'Chcete si přizpůsobit styly formulářů bez úpravy CSS?','Additional CSS Classes'=>'Dodatečné CSS třídy','Button Styles'=>'Styly tlačítka','Submit button is disabled during form submission.'=>'Tlačítko Odeslat je během odesílání formuláře deaktivováno.','Error message'=>'Chybová zpráva','Recaptcha error message'=>'Chybová zpráva Recaptcha','Form error message'=>'Chybová zpráva formuláře','%s Empty message.'=>'%s Prázdná zpráva.','%1$s Invalid email address %2$s.'=>'%1$s Neplatná e-mailová adresa %2$s.','<strong>You cannot use modern markup because you’re using the deprecated Credit Card field.</strong> If you’d like to use modern markup, replace your credit card field with a payment gateway like <a href="%s" target="_blank" rel="noopener noreferrer">Stripe</a>.'=>'<strong>Nemůžete použít moderní označení, protože používáte pole Kreditní karta, jejíž podpora byla ukončena.</strong> Chcete-li použít moderní označení, nahraďte pole kreditní karty platební bránou jako <a href="%s" target="_blank" rel="noopener noreferrer">Stripe</a>.','Check this option to use modern markup, which has increased accessibility and allows you to easily customize your forms in the block editor. <a href="%s" target="_blank" rel="noopener noreferrer">Read our form markup documentation</a> to learn more.'=>'Zaškrtněte tuto možnost, chcete-li použít moderní značkování, které zvýšilo přístupnost a umožňuje snadné přizpůsobení formulářů v editoru bloků. <a href="%s" target="_blank" rel="noopener noreferrer">Přečtěte si naši dokumentaci k označování formulářů</a>, kde se dozvíte více.','Dismiss this notice.'=>'Zavřít toto oznámení.','Cloudflare Turnstile is a free, CAPTCHA-like service for preventing form spam while protecting data privacy. It offers a user-friendly experience by confirming visitors are real humans without requiring them to solve puzzles or math questions.'=>'Cloudflare Turnstile je bezplatná služba podobná CAPTCHA, která zabraňuje formulářovému spamu a zároveň chrání soukromí dat. Nabízí uživatelsky přívětivý zážitek tím, že potvrzuje, že návštěvníci jsou skutečnými lidmi, aniž by museli řešit hádanky nebo matematické otázky.','Dark'=>'Tmavá','Light'=>'Světlý','Auto'=>'Automaticky','Cloudflare Turnstile verification failed, please try again later.'=>'Ověření Cloudflare Turnstile se nezdařilo, prosím zkuste to znovu později.','Not sure which service is right for you? <a href="%s" target="_blank" rel="noopener noreferrer">Check out our comparison</a> for more details.'=>'Nejste si jisti, která služba je pro Vás ta pravá? <a href="%s" target="_blank" rel="noopener noreferrer">Podívejte se na naše srovnání</a>, kde najdete další podrobnosti.','Cloudflare Turnstile'=>'Cloudflare Turnstile','Enable free, CAPTCHA-like spam protection that protects data privacy.'=>'Povolit bezplatnou ochranu proti spamu podobnou CAPTCHA, která chrání soukromí dat.','Enable Cloudflare Turnstile'=>'Povolit Cloudflare Turnstile','Made with ♥ by the WPForms Team'=>'Vyrobeno s ♥ týmem WPForms','Free Plugins'=>'Bezplatné Pluginy','Basic Protection, reCAPTCHA, hCaptcha, Cloudflare Turnstile, Akismet, Country Filter, Keyword Filter, and Custom Captcha'=>'Základní ochrana, reCAPTCHA, hCaptcha, Cloudflare Turnstile, Akismet, filtr země, filtr klíčových slov a vlastní captcha','Basic Protection, reCAPTCHA, hCaptcha, Cloudflare Turnstile and Akismet'=>'Základní ochrana, reCAPTCHA, hCaptcha, Cloudflare Turnstile a Akismet','Leading WordPress backup & site migration plugin. Over 1,500,000+ smart website owners use Duplicator to make reliable and secure WordPress backups to protect their websites. It also makes website migration really easy.'=>'Přední WordPress plugin pro zálohování a migraci webu. Více než 1 500 000 majitelů chytrých webových stránek používá Duplicator k vytváření spolehlivých a bezpečných záloh WordPress k ochraně svých webu. Díky tomu je migrace webu opravdu snadná.','Duplicator'=>'Duplikátor','Future proof your WordPress customizations with the most popular code snippet management plugin for WordPress. Trusted by over 1,500,000+ websites for easily adding code to WordPress right from the admin area.'=>'Zajistěte si budoucí přizpůsobení WordPress pomocí nejoblíbenějšího pluginu pro správu úryvků kódu pro WordPress. Více než 1 500 000 webů důvěřuje tomuto pluginu a přidává kód do WordPressu přímo z administrátorské oblasti.','WPCode'=>'WPCode','Sorry, we didn\'t find any matching icons.'=>'Litujeme, nenašli jsme žádné odpovídající ikony.','Browse or search for the perfect icon.'=>'Procházejte nebo hledejte perfektní ikonu.','The icon library appears to be missing or damaged. It will now be reinstalled.'=>'Zdá se, že knihovna ikon chybí nebo je poškozená. Nyní bude znovu nainstalován.','There was an error installing the icon library. Please try again later or <a href="%s" target="_blank" rel="noreferrer noopener">contact support</a> if the issue persists.'=>'Při instalaci knihovny ikon došlo k chybě. Zkuste to znovu později nebo pokud problém přetrvává, <a href="%s" target="_blank" rel="noreferrer noopener">kontaktujte podporu</a>.','The icon library has been installed successfully. We will now save your form and reload the form builder.'=>'Knihovna ikon byla úspěšně nainstalována. Nyní formulář uložíme a znovu načteme tvůrce formulářů.','This should only take a minute. Please don’t close or reload your browser window.'=>'Mělo by to trvat jen minutu. Nezavírejte ani znovu nenačítajte okno prohlížeče.','Installing Icon Library'=>'Instalace knihovny ikon','In order to use the Icon Choices feature, an icon library must be downloaded and installed. It\'s quick and easy, and you\'ll only have to do this once.'=>'Abyste mohli používat funkci Výběru ikon, musíte si stáhnout a nainstalovat knihovnu ikon. Je to rychlé a snadné a budete to muset udělat jen jednou.','Done!'=>'Hotovo!','You can’t import forms because you don’t have unfiltered HTML permissions. Please contact your site administrator or <a href="%s" target="_blank" rel="noopener noreferrer">reach out to our support team</a>.'=>'Nemůžete importovat formuláře, protože nemáte nefiltrovaná oprávnění HTML. Obraťte se prosím na svého správce webu nebo <a href="%s" target="_blank" rel="noopener noreferrer">kontaktujte náš tým podpory</a>.','Enter the email address or email address with recipient\'s name in "First Last %s" format.'=>'Zadejte e-mailovou adresu nebo e-mailovou adresu se jménem příjemce ve formátu "Jméno Příjmení %s".','Select the style for the icon choices.'=>'Vyberte styl pro volby ikon.','Select icon size.'=>'Vyberte velikost ikony.','Icon Size'=>'Velikost ikony','Select an accent color for the icon choices.'=>'Vyberte barvu zvýraznění pro volby ikon.','Icon Color'=>'Barva ikony','Enable this option to use icons with the choices.'=>'Povolte tuto možnost, chcete-li s volbami používat ikony.','Entries are securely backed up in the cloud. Upgrade to restore.'=>'Záznamy jsou bezpečně uloženy v cloudu. Upgrade pro obnovení.','Incorrect usage of this operation.'=>'Nesprávné použití této operace.','We recommend that you edit your forms on a bigger screen. If you\'d like to proceed, please understand that some functionality might not behave as expected.'=>'Doporučujeme upravovat formuláře na větší obrazovce. Pokud chcete pokračovat, uvědomte si prosím, že některé funkce se nemusí chovat podle očekávání.','Enable File Upload Attachments'=>'Povolit přílohy k nahrávání souborů','New Templates'=>'Nové šablony','Favorite Templates'=>'Oblíbené šablony','Text'=>'Text','Integrate the powerful spam-fighting service trusted by millions of sites.'=>'Integrujte výkonnou službu pro boj se spamem, které důvěřují miliony webů.','Turn on free, privacy-oriented spam prevention that displays a visual CAPTCHA.'=>'Povolit bezplatnou ochranu proti spamu zaměřenou na soukromí, která zobrazuje vizuální CAPTCHA.','Add Google\'s free anti-spam service and choose between visible or invisible CAPTCHAs.'=>'Přidejte si bezplatnou antispamovou službu Google a vyberte si mezi viditelnými nebo neviditelnými CAPTCHA.','Add to Form'=>'Přidat do formuláře','Ask custom questions or require your visitor to answer a random math puzzle.'=>'Pokládejte vlastní otázky nebo požádejte Vašeho návštěvníka, aby odpověděl na náhodnou matematickou hádanku.','Block form entries that contain specific words or phrases that you define.'=>'Blokovat položky formuláře, které obsahují konkrétní slova nebo fráze, které definujete.','Keyword Filter'=>'Filtr klíčových slov','Stop spam at its source. Allow or deny entries from specific countries.'=>'Zastavte spam u jeho zdroje. Povolte nebo zakažte záznamy z konkrétních zemí.','Country Filter'=>'Filtr země','Get Started &rarr;'=>'Začít &rarr;','Automated tests that help to prevent bots from submitting your forms.'=>'Automatické testy, které pomáhají zabránit robotům v odesílání Vašich formulářů.','Enable third-party CAPTCHAs to prevent form submissions from bots.'=>'Povolit obrázky CAPTCHA třetích stran, abyste zabránili odesílání formulářů roboty.','Also Available'=>'Také dostupný','Protection'=>'Ochrana','Behind-the-scenes spam filtering that\'s invisible to your visitors.'=>'Filtrování spamu ze zákulisí, které je pro Vaše návštěvníky neviditelné.','Turn on invisible spam protection.'=>'Zapnout neviditelnou ochranu proti spamu.','Error ID: %s.'=>'ID chyby: %s.','Check the WPForms &raquo; Tools &raquo; <a href="%s">Logs</a> for more details.'=>'Další podrobnosti naleznete ve WPForms &raquo; Nástroje &raquo; <a href="%s">Logy</a>.','Your form has not been submitted because data is missing from the entry.'=>'Formulář nebyl odeslán, protože v záznamu chybí data.','Missing form data on form submission process %s'=>'Chybějící data formuláře při procesu odeslání formuláře %s','Multi-page Forms, File Upload Forms, Multiple Form Notifications, File Upload and CSV Attachments, Conditional Form Confirmation, Save and Resume Form'=>'Vícestránkové formuláře, formuláře pro odesílání souborů, Nahrávání souborů a CSV přílohy, oznámení o více formulářích, podmíněné potvrzení formulářů, uložení a obnovení formuláře','Additional Anti-Spam Settings'=>'Dodatečné nastavení Anti-Spam','Basic Anti-Spam Settings'=>'Základní nastavení Anti-Spam','Spam Protection and Security'=>'Ochrana a zabezpečení proti spamu','Recommended'=>'Doporučený','Mark as Favorite'=>'Označit jako oblíbené','Remove from Favorites'=>'Odstranit z oblíbených','Entry CSV Attachment'=>'Zálohování CSV příloh','Enable Entry CSV Attachment'=>'Povolit zálohování CSV příloh','Create Form'=>'Vytvořit formulář','Available Templates'=>'Dostupné šablony','Sorry, we didn\'t find any templates that match your criteria.'=>'Litujeme, nenašli jsme žádné šablony, které odpovídají Vašim kritériím.','Choose a template to speed up the process of creating your form. You can also start with a <a href="#" class="wpforms-trigger-blank">blank form</a> or <a href="%1$s" target="_blank" rel="noopener noreferrer">create your own</a>. <br>Have a suggestion for a new template? <a href="%2$s" target="_blank" rel="noopener noreferrer">We’d love to hear it</a>!'=>'Výběrem šablony urychlíte proces vytváření formuláře. Můžete také začít s <a href="#" class="wpforms-trigger-blank">prázdným formulářem</a> nebo <a href="%1$s" target="_blank" rel="noopener noreferrer">vytvořte si vlastní</a>. <br>Máte návrh na novou šablonu? <a href="%2$s" target="_blank" rel="noopener noreferrer">Rádi si to poslechneme</a>!','Layout'=>'Rozvržení','Never start from scratch again! While WPForms Lite allows you to create any type of form, you can save even more time with WPForms Pro. Upgrade to access hundreds more form templates and advanced form fields.'=>'Už nikdy nezačínejte od nuly! Zatímco WPForms Lite umožňuje vytvářet jakýkoli typ formuláře, s WPForms Pro můžete ušetřit ještě více času. Upgradujte a získejte přístup ke stovkám dalších šablon formulářů a pokročilých polí formulářů.','Get Access to Our Library of %d Pre-Made Form Templates'=>'Získejte přístup do naší knihovny %d před-vytvořených šablon formulářů','WPForms Templates'=>'WPForms Šablony','After purchasing a license, just <strong>enter your license key on the WPForms Settings page</strong>. This will let your site automatically upgrade to %s! (Don\'t worry, all your forms and settings will be preserved.)'=>'Po zakoupení licence stačí <strong>zadat licenční klíč na stránce Nastavení WPForms</strong>. Stránky tak budou automaticky upgradovány na %s! (Nemějte obavy, všechny formuláře a nastavení zůstanou zachovány.)','Please check out our <a href="%1$s" target="_blank" rel="noopener noreferrer">doc on fixing email delivery issues</a> for more details.'=>'Podrobnosti naleznete v našem <a href="%1$s" target="_blank" rel="noopener noreferrer">dokumentaci o řešení problémů s doručováním e-mailů</a>.','Alternately, try using a From Address that matches your website domain (admin@%1$s).'=>'Případně zkuste použít adresu odesílatele, která odpovídá doméně Vašeho webu (admin@%1$s).','We strongly recommend that you install the free <a href="%1$s" target="_blank">WP Mail SMTP</a> plugin! The Setup Wizard makes it easy to fix your emails.'=>'Silně doporučujeme nainstalovat bezplatný plugin <a href="%1$s" target="_blank">WP Mail SMTP</a>! Průvodce nastavením usnadňuje opravu e-mailů.','Anti-spam verification failed, please try again later.'=>'Anti-spamové ověření se nezdařilo, zkuste to prosím znovu později.','PayPal Commerce'=>'PayPal Commerce','The "Account Nickname" is required.'=>'"Přezdívka účtu" je povinná.','The "Authorization Code" is required.'=>'Je vyžadován "Autorizační kód".','#%d (no name)'=>'#%d (beze jména)','This field is disabled in the editor mode.'=>'Toto pole je v režimu editoru zakázáno.','Dismiss'=>'Zamítnout','You should enter a valid absolute address to the CTA Link field or leave it empty.'=>'Měli byste zadat platnou absolutní adresu do pole Odkaz na výzvu k akci nebo nechat prázdné.','CTA is hidden if Expanded Content is used.'=>'Při použití rozšířeného obsahu je výzva k akci skrytá.','Enter the URL for the form field call to action button. URL will be ignored if the field has extended description content: in that case button will be used to expand the description content.'=>'Zadejte URL tlačítka s výzvou k akci v poli formuláře. URL je ignorována, pokud má pole rozšířený obsah popisu: v tomto případě se tlačítko používá k rozšíření obsahu popisu.','CTA Link'=>'Odkaz na výzvu k akci','CTA Label'=>'Štítek výzvy k akci','Adds an expandable content area below the description.'=>'Přidá rozšířitelnou oblast obsahu pod popis.','Enter text for the form field expanded description.'=>'Zadejte text pro rozšířený popis pole formuláře.','Expanded Content'=>'Rozšířený obsah','Enter text for the form field heading.'=>'Zadejte text pro záhlaví pole formuláře.','This field is not editable'=>'Toto pole nelze upravovat','Internal Information'=>'Interní informace','Please fill out the field in required format.'=>'Vyplňte prosím pole v požadovaném formátu.','Accept payments using PayPal Commerce, Stripe, Square, PayPal Standard, and Authorize.Net'=>'Přijímejte platby pomocí PayPal Commerce, Stripe, Square, PayPal Standard a Authorize.Net','Accept payments using PayPal Commerce, Stripe, Square, and PayPal Standard'=>'Přijímejte platby pomocí PayPal Commerce, Stripe, Square a PayPal Standard','Custom'=>'Vlastní','Enable Akismet anti-spam protection'=>'Povolit antispamovou ochranu Akismet','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been properly configured</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Tuto funkci v tuto chvíli nelze použít, protože plugin Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">nebyl správně nakonfigurován</a>. Informace o použití této funkce <a href="%2$s" target="_blank" rel="noopener noreferrer">naleznete v naší dokumentaci</a>.','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been activated</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Tuto funkci v tuto chvíli nelze použít, protože plugin Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">nebyl aktivován</a>. Informace o použití této funkce <a href="%2$s" target="_blank" rel="noopener noreferrer">naleznete v naší dokumentaci</a>.','This feature cannot be used at this time because the Akismet plugin <a href="%1$s" target="_blank" rel="noopener noreferrer">has not been installed</a>. For information on how to use this feature please <a href="%2$s" target="_blank" rel="noopener noreferrer">refer to our documentation</a>.'=>'Tuto funkci v tuto chvíli nelze použít, protože plugin Akismet <a href="%1$s" target="_blank" rel="noopener noreferrer">není nainstalován</a>. Informace o použití této funkce <a href="%2$s" target="_blank" rel="noopener noreferrer">naleznete v naší dokumentaci</a>.','Mapbox API'=>'Mapbox API','Collect the names, emails, and messages from site visitors that need to talk to you.'=>'Sbírejte jména, e-maily a zprávy od návštěvníků webu, kteří s Vámi potřebují mluvit.','The template you selected is currently not available, but you can try again later. If you continue to have trouble, please reach out to support.'=>'Šablona, ​​kterou jste vybrali, není momentálně k dispozici, ale můžete to zkusit znovu později. Pokud potíže přetrvávají, obraťte se na podporu.','When you’re ready to manage your entries inside WordPress, <a href="%1$s" target="_blank" rel="noopener noreferrer">upgrade to Pro</a> to import your entries.'=>'Až budete připraveni spravovat své záznamy ve WordPressu, <a href="%1$s" target="_blank" rel="noopener noreferrer">upgradujte na verzi Pro</a> a importujte své záznamy.','Backups are completely free, 100%% secure, and you can turn them on in a few clicks! <a href="%1$s" target="_blank" rel="noopener noreferrer">Enable entry backups now.</a>'=>'Zálohy jsou zcela zdarma, 100%% bezpečné a můžete je zapnout na pár kliknutí! <a href="%1$s" target="_blank" rel="noopener noreferrer">Povolit zálohování záznamů nyní.</a>','We recommend that you enable entry backups to guard against lost entries.'=>'Doporučujeme povolit zálohování záznamů, abyste zabránili jejich ztrátě.','Note: Entry backups are not enabled.'=>'Poznámka: Zálohování záznamů není povoleno.','Check out what else you’ll get with your Pro license.'=>'Podívejte se, co dalšího získáte s licencí Pro.','Your entries are being backed up securely in the cloud. When you’re ready to manage your entries inside WordPress, just <a href="%1$s" target="_blank" rel="noopener noreferrer">upgrade to Pro</a> and we’ll automatically import them in seconds!'=>'Záznamy jsou bezpečně zálohovány v cloudu. Až budete připraveni spravovat své záznamy ve WordPressu, stačí <a href="%1$s" target="_blank" rel="noopener noreferrer">upgradovat na verzi Pro</a> a my je automaticky importujeme do sekundy!','We’ve got you covered!'=>'Je o Vás postaráno!','Below is the total number of submissions for each form. However, form entries are not stored by WPForms Lite.'=>'Níže je uveden celkový počet příspěvků pro každý formulář. Záznamy formulářů však WPForms Lite neukládá.','Update'=>'Aktualizovat','Unique Value'=>'Jedinečná hodnota','No such record.'=>'Žádný takový záznam.','Record ID not found'=>'ID záznamu nebylo nalezeno','Your form entries can’t be backed up because WPForms can’t connect to the backup server. If you’d like to back up your entries, find out how to <a href="%s" target="_blank" rel="noopener noreferrer">fix entry backup issues</a>.'=>'Záznamy formuláře nelze zálohovat, protože WPForms se nemůže připojit k záložnímu serveru. Pokud chcete své záznamy zálohovat, zjistěte, jak <a href="%s" target="_blank" rel="noopener noreferrer">opravit problémy se zálohováním záznamů</a>.','Watch Video'=>'Podívejte se na video','You just hit 100 entries&hellip; and this is just the beginning! Now it’s time to dig into the data and figure out what makes your visitors tick. The User Journey addon shows you what your visitors looked at before submitting your form. Now you can easily find which areas of your site are triggering form conversions.'=>'Právě jste dosáhli 100 záznamů&hellip; a to je jen začátek! Nyní je čas ponořit se do dat a zjistit, co návštěvníky láká. Doplněk User Journey Vám ukáže, na co se návštěvníci dívali před odesláním formuláře. Nyní můžete snadno zjistit, které oblasti webu spouštějí konverze formulářů.','Share Your Idea'=>'Podělte se o svůj nápad','If you could add just one feature to WPForms, what would it be? We want to know! Our team is busy surveying valued customers like you as we plan the year ahead. We’d love to know which features would take your business to the next level! Do you have a second to share your idea with us?'=>'Pokud byste mohli do WPForms přidat pouze jednu funkci, která by to byla? Chceme to vědět! Náš tým je zaneprázdněn průzkumem vážených zákazníků, jako jste Vy, jak plánujeme na rok dopředu. Rádi bychom slyšeli, jaké funkce by Vaši firmu posunuly na další úroveň. Máte chvilku, abyste se s námi podělili o svůj nápad?','What’s Your Dream WPForms Feature?'=>'Jaká je Vaše vysněná funkce WPForms?','Are your forms converting fewer visitors than you hoped? Often, visitors quit forms partway through. That can prevent you from getting all the leads you deserve to capture. With our Form Abandonment addon, you can capture partial entries even if your visitor didn’t hit Submit! From there, it’s easy to follow up with leads and turn them into loyal customers.'=>'Přinášejí Vaše formuláře méně návštěvníků, než jste doufali? Návštěvníci často opouštějí formuláře v průběhu. To Vám může zabránit v získání všech stop, které si zasloužíte zachytit. S naším doplňkem Form Abandonment můžete zachytit částečné záznamy, i když Váš návštěvník nestiskl tlačítko Odeslat! Odtud je snadné sledovat potenciální zákazníky a přeměnit je na věrné zákazníky.','Get More Leads From Your Forms!'=>'Získejte více potenciálních zákazníků ze svých formulářů!','Nothing beats real feedback from your customers and visitors. That’s why many small businesses love our awesome Surveys and Polls addon. Instantly unlock full survey reporting right in your WordPress dashboard. And don’t forget: building a survey is easy with our pre-made templates, so you could get started within a few minutes!'=>'Nic nepřekoná skutečnou zpětnou vazbu od Vašich zákazníků a návštěvníků. To je důvod, proč mnoho malých podniků miluje náš úžasný doplněk Průzkumy a ankety. Okamžitě odemkněte úplné přehledy průzkumů přímo na hlavním panelu WordPress. A nezapomeňte: vytvoření průzkumu je snadné s našimi předem připravenými šablonami, takže můžete začít během několika minut!','Want to Know What Your Customers Really Think?'=>'Chcete vědět, co si Vaši zákazníci skutečně myslí?','Running a WordPress site can be challenging. But help is just around the corner! Our Facebook group contains tons of tips and help to get your business growing! When you join our VIP Circle, you’ll get instant access to tips, tricks, and answers from a community of loyal WPForms users. Best of all, membership is 100% free!'=>'Provozování webu WordPress může být náročné. Ale pomoc je hned za rohem! Naše skupina na Facebooku obsahuje spoustu tipů a pomoci, aby Vaše podnikání rostlo! Když se připojíte k našemu VIP kruhu, získáte okamžitý přístup k tipům, trikům a odpovědím od komunity věrných uživatelů WPForms. Nejlepší ze všeho je, že členství je 100% zdarma!','Want to Be a VIP? Join Now!'=>'Chcete být VIP? Přidejte se hned teď!','Did you know that many WordPress sites are not properly configured to send emails? With the free WP Mail SMTP plugin, you can easily optimize your site to send emails, avoid the spam folder, and make sure your emails land in the recipient’s inbox every time.'=>'Věděli jste, že mnoho webů WordPress není správně nakonfigurováno pro odesílání e-mailů? S bezplatným pluginem WP Mail SMTP můžete snadno optimalizovat svůj web pro odesílání e-mailů, vyhnout se spamu a zajistit, aby se e-maily pokaždé dostaly do doručené pošty příjemce.','Don’t Miss Your Form Notification Emails!'=>'Nenechte si ujít e-maily s upozorněním na formulář!','Read the Guide'=>'Přečtěte si Průvodce','We’re grateful that you chose WPForms for your website! Now that you’ve installed the plugin, you’re less than 5 minutes away from publishing your first form. To make it easy, we’ve got %s form templates to get you started!'=>'Jsme vděční, že jste si pro svůj web vybrali WPForms! Nyní, když jste plugin nainstalovali, od publikování prvního formuláře Vás dělí méně než 5 minut. Abychom vám to usnadnili, máme více než %s šablon formulářů, které vám pomohou začít!','Welcome to WPForms!'=>'Vítejte ve WPForms!','Edit Tags'=>'Upravit tagy','Filter'=>'Filtr','Save changes'=>'Uložit změny',', '=>', ','Refresh'=>'Obnovit','In order to update the tags in the forms list, please refresh the page.'=>'Chcete-li aktualizovat tagy v seznamu formulářů, obnovte stránku.','Almost done!'=>'Téměř hotovo!','1 tag was successfully deleted.'=>'1 tag byl úspěšně smazán.','There are no tags to delete.<br>Please create at least one by adding it to any form.'=>'Neexistují žádné tagy k odstranění.<br>Vytvořte prosím alespoň jednu tak, že jej přidáte do libovolného formuláře.','You have <strong>%d tags</strong> selected for deletion.'=>'Vybrali jste <strong>%d tagů</strong> ke smazání.','You have <strong>1 tag</strong> selected for deletion.'=>'Vybrali jste <strong>1 tag</strong> ke smazání.','Delete Tags'=>'Smazat tagy','Delete tags that you\'re no longer using. Deleting a tag will remove it from a form, but will not delete the form itself.'=>'Smažte tagy, které již nepoužíváte. Odstraněním tagu se odstraní z formuláře, ale neodstraní se samotný formulář.','Manage Tags'=>'Spravovat tagy','<strong>%d forms</strong> selected for Bulk Edit.'=>'Pro hromadné úpravy bylo vybráno <strong>%d formulářů</strong>.','<strong>1 form</strong> selected for Bulk Edit.'=>'Pro hromadné úpravy byl vybrán <strong>1 formulář</strong>.','All Tags'=>'Všechny tagy','No tags to choose from'=>'Není k dispozici žádný tag','No forms selected when trying to add a tag to them.'=>'Při pokusu o přidání tagu nebyly vybrány žádné formuláře.','Most likely, your session expired. Please reload the page.'=>'S největší pravděpodobností relace vypršela. Načtěte stránku znovu.','Türkiye'=>'Turecko','We’ve detected the same text in your allowlist and denylist. To prevent a conflict, we’ve removed the following text from the list you’re currently viewing:'=>'Ve seznamu povolených a zamítnutých jsme našli stejný text. Abychom předešli konfliktu, odstranili jsme následující text ze seznamu, který si právě prohlížíte:','How to use Prefill by URL'=>'Jak používat Předvyplnění podle URL','Enable Prefill by URL'=>'Povolit předvyplnění podle URL','Mark form with the tags. To create a new tag, simply type it and press Enter.'=>'Označte formulář pomocí tagů. Chcete-li vytvořit nový tag, jednoduše jej napište a stiskněte klávesu Enter.','Tags'=>'Tagy','Press Enter or "," key to add new tag'=>'Stisknutím klávesy Enter nebo "," přidáte nový tag','Save Changes'=>'Uložit změny','WordPress'=>'WordPress','Color Scheme'=>'Barevné schéma','Bar'=>'Lišta','<strong>Your form entries are not being stored in WordPress, and your entry backups are not active.</strong> If there\'s a problem with deliverability, you\'ll lose form entries. We recommend that you enable Entry Backups, especially if you\'re considering <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgrading to WPForms PRO</a>.'=>'<strong>Záznamy formuláře se neukládají ve WordPressu a zálohy záznamů nejsou aktivní.</strong> Pokud dojde k problému s doručitelností, ztratíte záznamy formuláře. Doporučujeme povolit zálohy záznamů zvláště pokud zvažujete <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal"> upgrade na WPForms PRO</a>.','<strong>Your form entries are not being stored locally, but are backed up remotely.</strong> If you <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgrade to WPForms PRO</a>, you can restore your entries and they’ll be available in the WordPress dashboard.'=>'<strong>Záznamy formuláře se neukládají lokálně, ale zálohují se vzdáleně.</strong> Pokud <a href="%s" target="_blank" rel="noopener noreferrer" class="wpforms-upgrade-modal">upgradujete na WPForms PRO</a>, můžete záznamy obnovit a budou k dispozici na hlavním panelu WordPress.','Enable Form Entry Backups for Free'=>'Povolit zálohování záznamů formuláře Zdarma','Enable Form Entry Backups'=>'Povolit zálohování záznamů formuláře','Unfortunately, the error occurs while updating Form Entry Backups setting. Please try again later.'=>'Bohužel došlo k chybě při aktualizaci nastavení Zálohování záznamů formuláře. Prosím zkuste to znovu později.','Form Entry Backups were successfully disabled.'=>'Zálohy záznamů formuláře byly úspěšně zakázány.','Entry Backups Disabled'=>'Zálohování záznamů zakázáno','Awesome! If you decide to upgrade to WPForms Pro, you can restore your entries and will have instant access to reports.'=>'Brilantní! Pokud se rozhodnete upgradovat na WPForms Pro, můžete obnovit své záznamy a mít okamžitý přístup k přehledům.','Entry Backups Enabled'=>'Zálohování záznamů povoleno','Disable Entry Backups'=>'Zakázat zálohování záznamů','If you disable Lite Connect, you will no longer be able to restore your entries when you upgrade to WPForms Pro.'=>'Pokud zakážete Lite Connect, nebudete již moci obnovit své záznamy při upgradu na WPForms Pro.','Are you sure?'=>'Jste si jistý?','No Thanks'=>'Ne, děkuji','since %s'=>'od %s','%d entry backed up'=>'%d záznam zálohován' . "\0" . '%d záznamy zálohovány' . "\0" . '%d záznamů zálohováno','Entries Backups Are Enabled'=>'Zálohy záznamů jsou povoleny','Enable Entry Backups'=>'Povolit zálohování záznamů','Entries are available through email notifications. If you enable Entry Backups, you can restore them once you upgrade to WPForms Pro.'=>'Příspěvky jsou dostupné prostřednictvím e-mailových upozornění. Pokud povolíte Zálohy záznamů, můžete je obnovit, jakmile upgradujete na WPForms Pro.','Entries are not stored in WPForms Lite'=>'Záznamy nejsou uloženy ve WPForms Lite','This is a preview of the latest saved revision of your form. If this preview does not match your form, save your changes and then refresh this page. This form preview is not publicly accessible.'=>'Toto je náhled poslední uložené revize Vašeho formuláře. Pokud tento náhled neodpovídá Vašemu formuláři, uložte změny a poté tuto stránku obnovte. Tento náhled formuláře není veřejně přístupný.','(no title)'=>'(bez názvu)','Inactive widgets'=>'Neaktivní widgety','Form Locations'=>'Umístění formuláře','View form locations'=>'Zobrazení umístění formuláře','Form locations'=>'Umístění formuláře','Block Widget'=>'Blokovat widget','WPForms Widget'=>'WPForms Widget','Last %d day'=>'Poslední %d den' . "\0" . 'Poslední %d dny' . "\0" . 'Posledních %d dnů','Select timespan'=>'Vyberte časové období','Upgrade to WPForms Pro & Restore Form Entries'=>'Upgradujte na WPForms Pro a obnovte záznamy formuláře','since you enabled Lite Connect on %s'=>'protože jste na %s aktivovali Lite Connect','%d entry has been backed up'=>'Záznam %d byl zálohován' . "\0" . 'Záznamy %d byly zálohovány' . "\0" . 'Záznamů %d bylo zálohováno','By enabling Lite Connect you agree to our <a href="%s" target="_blank" rel="noopener noreferrer">Terms of Service</a> and to share your information with WPForms.'=>'Povolením Lite Connect souhlasíte s našimi <a href="%s" target="_blank" rel="noopener noreferrer">Smluvními podmínkami</a> a se sdílením vašich informací s WPForms.','Ready to grow your website? Get the latest pro tips and updates from the WPForms team.'=>'Jste připraveni rozšířit svůj web? Získejte nejnovější profesionální tipy a aktualizace od týmu WPForms.','WPForms Newsletter'=>'Zpravodaj WPForms','WPForms Newsletter.'=>'Zpravodaj WPForms.','When you upgrade to WPForms Pro, we\'ll automatically restore all of the entries that you collected in WPForms Lite.'=>'Když upgradujete na WPForms Pro, automaticky obnovíme všechny záznamy, které jste shromáždili ve WPForms Lite.','Backup & Restore'=>'Záloha & Obnova','Backup and Restore.'=>'Záloha a Obnova.','Entries are stored securely and privately until you\'re ready to upgrade. Our team cannot view your forms or entries.'=>'Záznamy jsou uloženy bezpečně a soukromě, dokud nebudete připraveni na upgrade. Náš tým nemůže zobrazit Vaše formuláře nebo záznamy.','Security & Protection'=>'Bezpečnost & Ochrana','Security and Protection.'=>'Bezpečnost a ochrana.','If your email notifications aren\'t delivered, you’ll lose form entries. Turn on free backups now and restore your entries when you upgrade to Pro.'=>'Pokud Vaše e-mailová oznámení nebudou doručena, ztratíte záznamy formuláře. Zapněte si bezplatné zálohování a obnovte své záznamy, když upgradujete na Pro.','Form Entry Backups'=>'Zálohy záznamů formuláře','Easily restore your entries when you upgrade to WPForms Pro.'=>'Při upgradu na WPForms Pro snadno obnovíte své záznamy.','Restore Form Entries'=>'Obnovit záznamy formuláře','Form Entry Backups Are Enabled'=>'Zálohy záznamů formuláře jsou povoleny','WPForms now offers offsite backups for your form entries. If you decide to upgrade to WPForms Pro, you can restore entries collected while you used WPForms Lite.'=>'WPForms nyní nabízí offsite zálohy pro Vaše záznamy formuláře. Pokud se rozhodnete upgradovat na WPForms Pro, můžete obnovit záznamy shromážděné při používání WPForms Lite.','One More Thing'=>'Ještě jedna věc','Read