lostí včetně plateb, plánování, časových pásem, prodeje vstupenek, opakujících se událostí a další.','Sugar Calendar'=>'Sugar Calendar','The best WordPress eCommerce plugin for selling digital downloads. Start selling eBooks, software, music, digital art, and more within minutes. Accept payments, manage subscriptions, advanced access control, and more.'=>'Nejlepší plugin pro elektronický obchod WordPress pro prodej digitálního stahování. Začněte prodávat elektronické knihy, software, hudbu, digitální umění a další během několika minut. Přijímejte platby, spravujte předplatné, pokročilé řízení přístupu a další.','Easy Digital Downloads'=>'Snadné digitální stahování','WP Simple Pay Pro'=>'WP Simple Pay Pro','WP Simple Pay'=>'WP Simple Pay','AffiliateWP'=>'AffiliateWP','The most advanced WordPress search plugin. Customize your WordPress search algorithm, reorder search results, track search metrics, and everything you need to leverage search to grow your business.'=>'Nejpokročilejší vyhledávací plugin WordPress. Přizpůsobte si svůj vyhledávací algoritmus WordPress, změňte pořadí výsledků vyhledávání, sledujte metriky vyhledávání a vše, co potřebujete k využití vyhledávání k růstu Vašeho podnikání.','SearchWP'=>'SearchWP','Collect signatures, geolocation data, and file uploads'=>'Sbírejte podpisy, geolokační data a nahrávání souborů','Let users save & resume submissions to prevent abandonment'=>'Umožněte uživatelům ukládat a obnovovat příspěvky, abyste se vyhnuli opuštění.','7000+ integrations with marketing and payment services'=>'Více než 7000 integrací s marketingovými a platebními službami','Unlock all fields & features, including smart conditional logic'=>'Odemkněte všechna pole & funkce, včetně chytré podmíněné logiky','Store and manage form entries in WordPress'=>'Ukládejte a spravujte položky formulářů ve WordPressu','%s customizable form templates'=>'%s přizpůsobitelných šablon formulářů','This field cannot be duplicated.'=>'Toto pole nelze duplikovat.','This field cannot be deleted.'=>'Toto pole nelze odstranit.','Security'=>'Zabezpečení','Pro mailers: Amazon SES, Microsoft 365 / Outlook.com, Zoho Mail.'=>'Placení správci mailů: Amazon SES, Microsoft 365 / Outlook.com, Zoho Mail.','Free mailers: SendLayer, SMTP.com, Brevo, Google Workspace / Gmail, Mailgun, Postmark, SendGrid.'=>'Free správci mailů: SMTP.com, Brevo, Google Workspace / Gmail, Mailgun, Postmark, SendGrid.','Used by 2+ million websites.'=>'Používá více než 2 miliony webů.','Improves email deliverability in WordPress.'=>'Zlepšuje doručitelnost e-mailů ve WordPressu.','WP Mail SMTP fixes deliverability problems with your WordPress emails and form notifications. It\'s built by the same folks behind WPForms.'=>'WP Mail SMTP řeší problémy s doručitelností Vašich e-mailů WordPress a oznámení o formulářích. Je vyvíjen stejnými lidmi za WPForms.','Taiwan, Republic of China'=>'Tchaj-wan, Čínská republika','Selected Value: %s'=>'Vybraná hodnota: %s','To ensure your form is accessible, every field should have a descriptive label. If you\'d like to hide the label, you can do so by enabling Hide Label in the Advanced Field Options tab.'=>'Aby byl formulář přístupný, mělo by mít každé pole popisný štítek. Pokud chcete štítek skrýt, můžete tak učinit povolením Skrýt štítek na kartě Rozšířené možnosti pole.','Label Hidden'=>'Skryté označení','The total size of the selected files %1$.3f MB exceeds the allowed limit %2$.3f MB.'=>'Celková velikost vybraných souborů %1$.3f Mb překračuje povolený limit %2$.3f Mb.','%1$s of %2$s max words.'=>'%1$s z %2$s maximálního počtu slov.','%1$s of %2$s max characters.'=>'%1$s z %2$s maximálního počtu znaků.','Limit is %1$s words. Words remaining: %2$s.'=>'Limitem je %1$s slov. Počet zbývajících slov: %2$s.','Limit is %1$s characters. Characters remaining: %2$s.'=>'Limitem je %1$s znaků. Počet zbývajících znaků: %2$s.','Did you mean %s?'=>'Měli jste na mysli %s?','Hide Helper'=>'Skrýt pomocníka','Empty Label'=>'Prázdný popisek','This field