pan> formuláře. Výsledky si můžete prohlédnout níže.','Importing <span class="form-current">1</span> of <span class="form-total">0</span> forms from %s.'=>'Import<span class="form-current">1</span> z <span class="form-total">0</span> formulářů z %s.','Analyzing <span class="form-current">1</span> of <span class="form-total">0</span> forms from %s.'=>'Analýza<span class="form-current">1</span> z <span class="form-total">0</span> formulářů z %s.','%s Field'=>'%s pole','Are you sure you want to delete this form and all its entries?'=>'Opravdu chcete smazat tento formulář a všechny jeho informace?','Could not install the plugin. Please download and install it manually.'=>'Plugin nelze nainstalovat. Prosím, stáhněte ho a nainstalujte ručně.','Address, Phone, Website / URL, Date / Time, Password, File Upload, Layout, Rich Text, Content, HTML, Pagebreaks, Entry Preview, Section Dividers, Ratings, and Hidden Field'=>'Adresa, telefon, web / URL, datum / čas, heslo, nahrání souboru, rozvržení, formátovaný text, obsah, HTML, konce stránek, náhled záznamu, oddělovače sekcí, hodnocení a skryté pole','Boost your sales and conversions by up to 15% with real-time social proof notifications. TrustPulse helps you show live user activity and purchases to help convince other users to purchase.'=>'Zvyšte své tržby a konverze až o 15% pomocí upozornění na sociální zabezpečení v reálném čase. TrustPulse Vám pomůže ukázat živou aktivitu uživatelů a nákupy, abyste přesvědčili ostatní uživatele k nákupu.','TrustPulse'=>'TrustPulse','Smash Balloon Twitter Feeds Pro'=>'Smash Balloon Twitter Feeds Pro','Easily display Twitter content in WordPress without writing any code. Comes with multiple layouts, ability to combine multiple Twitter feeds, Twitter card support, tweet moderation, and more.'=>'Snadno zobrazujte obsah Twitteru ve WordPressu bez psaní jakéhokoli kódu. Dodává se s více rozvrženími, schopností kombinovat více kanálů Twitter, podporou karet Twitter, moderováním tweetů a dalšími.','Smash Balloon Twitter Feeds'=>'Smash Balloon Twitter Feeds','Smash Balloon YouTube Feeds Pro'=>'Smash Balloon YouTube Feeds Pro','Easily display YouTube videos on your WordPress site without writing any code. Comes with multiple layouts, ability to embed live streams, video filtering, ability to combine multiple channel videos, and more.'=>'Snadno zobrazujte YouTube videa na webu WordPress bez psaní jakéhokoli kódu. Dodává se s více rozvrženími, schopností vkládat živé přenosy, filtrováním videa, schopností kombinovat vícekanálová videa a dalšími.','Smash Balloon YouTube Feeds'=>'Smash Balloon YouTube Feeds','Smash Balloon Facebook Feeds Pro'=>'Smash Balloon Facebook Feeds Pro','Easily display Facebook content on your WordPress site without writing any code. Comes with multiple templates, ability to embed albums, group content, reviews, live videos, comments, and reactions.'=>'Snadno zobrazujte obsah Facebooku na webu WordPress bez psaní jakéhokoli kódu. Dodává se s několika šablonami, schopností vkládat alba, skupinový obsah, recenze, živá videa, komentáře a reakce.','Smash Balloon Facebook Feeds'=>'Smash Balloon Facebook Feeds','Smash Balloon Instagram Feeds Pro'=>'Smash Balloon Instagram Feeds Pro','Easily display Instagram content on your WordPress site without writing any code. Comes with multiple templates, ability to show content from multiple accounts, hashtags, and more. Trusted by 1 million websites.'=>'Snadno zobrazujte obsah Instagramu na webu WordPress bez psaní jakéhokoli kódu. Dodává se s více šablonami, schopností zobrazovat obsah z více účtů, hashtagy a dalšími. Důvěřuje 1 milion webů.','Smash Balloon Instagram Feeds'=>'Smash Balloon Instagram Feeds','Connect with your visitors after they leave your website with the leading web push notification software. Over 10,000+ businesses worldwide use PushEngage to send 15 billion notifications each month.'=>'Spojte se s Vašimi návštěvníky poté, co opustí Váš web, pomocí předního softwaru pro upozornění na web. Více než 10 000+ firem na celém světě používá PushEngage k zasílání 15 miliard oznámení každý měsíc.','PushEngage'=>'PushEngage','Turn your website visitors into brand ambassadors! Easily grow your email list, website traffic, and social media followers with the most powerful giveaways & contests plugin for WordPress.'=>'Proměňte své návštěvníky webových stránek v ambasadory značek! Snadno rozšiřte svůj e-mailový seznam, provoz na webu a sledovatele sociálních médií pomocí nejsilnějšího dárku a soutěží pro WordPress plugin.','SeedProd Pro'=>'SeedProd Pro','SeedProd'=>'SeedProd','AIOSEO Pro'=>'AIOSEO Pro','The original WordPress SEO plugin and toolkit that improves your website\'s search rankings. Comes with all the SEO features like Local SEO, WooCommerce SEO, sitemaps, SEO optimizer, schema, and more.'=>'Originální WordPress SEO plugin a sada nástrojů, které vylepšují hodnocení Vašeho webu. Dodává se se všemi funkcemi SEO, jako je Local SEO, WooCommerce SEO, soubory sitemap, SEO optimalizátor, schéma a další.','AIOSEO'=>'AIOSEO','Improve your WordPress email deliverability and make sure that your website emails reach user\'s inbox with the #1 SMTP plugin for WordPress. Over 3 million websites use it to fix WordPress email issues.'=>'Vylepšete doručitelnost e-mailů WordPress a zajistěte, aby se e-maily z Vašeho webu dostaly do doručené pošty uživatele pomocí pluginu SMTP č. 1 pro WordPress. Více než 3 miliony webů jej používají k opravě problémů s e-maily WordPress.','The leading WordPress analytics plugin that shows you how people find and use your website, so you can make data driven decisions to grow your business. Properly set up Google Analytics without writing code.'=>'Přední analytický plugin WordPress, který Vám ukáže, jak lidé nacházejí a používají web, takže můžete přijímat rozhodnutí na základě dat a rozšiřovat tak své podnikání. Správně nastavte Google Analytics bez psaní kódu.','Instantly get more subscribers, leads, and sales with the #1 conversion optimization toolkit. Create high converting popups, announcement bars, spin a wheel, and more with smart targeting and personalization.'=>'Okamžitě získejte více odběratelů, potenciálních zákazníků a prodejů pomocí sady nástrojů pro optimalizaci konverzí č. 1. Vytvářejte vyskakovací okna s vysokou konverzí, pruhy oznámení, roztočte kolo a další pomocí inteligentního cílení a personalizace.','Do you want to learn more about visitors who fill out your online forms? Our geolocation addon allows you to collect and store your website visitors geolocation data along with their form submission. This insight can help you to be better informed and turn more leads into customers. Furthermore, add a smart address field that autocompletes using the Google Places API.'=>'Chcete se dozvědět více o návštěvnících, kteří vyplňují vaše online formuláře? Náš doplněk geolokace vám umožňuje shromažďovat a ukládat geolokační údaje návštěvníků vašeho webu spolu s jejich odesláním formuláře. Tento přehled vám může pomoci být lépe informován a přeměnit více potenciálních zákazníků na skutečné zákazníky. Dále přidejte pole s inteligentní adresou, které se automaticky doplňuje pomocí rozhraní Google Places API.','Smart Address Field'=>'Chytré pole adresy','Address Autocomplete Field'=>'Pole automatického doplňování adresy','Location Info in Entries'=>'Informace o poloze v záznamech','Number Positive'=>'Kladné číslo','It seems you don\'t have any payment addons activated. Click one of the available addons and start accepting payments today!'=>'Zdá se, že nemáte aktivovány žádné doplňky pro platby. Klikněte na jeden z dostupných doplňků a začněte přijímat platby ještě dnes!','To edit the License Key, please first click the Remove Key button. Please note that removing this key will remove access to updates, addons, and support.'=>'Chcete-li upravit licenční klíč, nejprve klikněte na tlačítko Odebrat klíč. Upozorňujeme, že odebráním tohoto klíče odeberete přístup k aktualizacím, doplňkům a podpoře.','Bonaire, Saint Eustatius and Saba'=>'Bonaire, Svatý Eustach a Saba','Locations'=>'Poloha','This setting is disabled because you have the "Force From Email" setting enabled in the <a href="%s" target="_blank">WP Mail SMTP</a> plugin.'=>'Toto nastavení je zakázáno, protože máte u pluginu <a href="%s" target="_blank">WP Mail SMTP</a> povoleno nastavení "Vynutit z e-mailu".','This setting is disabled because you have the "Force From Name" setting enabled in the <a href="%s" target="_blank">WP Mail SMTP</a> plugin.'=>'Toto nastavení je zakázáno, protože v pluginu <a href="%s" target="_blank">WP Mail SMTP</a> máte povoleno nastavení "Vynutit od jména".','N/A'=>'Nedostupné','No Label'=>'Žádné označení','Form ID: %d'=>'ID formuláře: %d','Survey Results'=>'Výsledky průzkumu','Install & Activate'=>'Instalovat & aktivovat','Powerful location-based insights and features…'=>'Výkonné informace a funkce založené na poloze…','Google Places API'=>'Rozhraní Google Places API','Embedded Map in Forms'=>'Vložená mapa ve formulářích','Latitude/Longitude'=>'Zeměpisná šířka / délka','Postal/Zip Code'=>'Poštovní směrovací číslo','Country'=>'Stát','City'=>'Město','There was an error while installing an upgrade. Please download the plugin from wpforms.com and install it manually.'=>'Při instalaci upgradu došlo k chybě. Stáhněte si prosím plugin z wpforms.com a nainstalujte jej ručně.','WPForms Pro is installed but not activated.'=>'WPForms Pro je nainstalován, ale není aktivován.','You are not allowed to install plugins.'=>'Nemáte dovoleno instalovat pluginy.','Enable Address Autocomplete'=>'Povolit automatické doplnění adresy','We\'re sorry, Address Autocomplete is part of the Geolocation Addon and not available on your plan. Please upgrade to the PRO plan to unlock all these awesome features.'=>'Je nám líto, automatické doplňování adresy je součástí doplňku Geolokace a není ve vašem plánu k dispozici. Upgradujte prosím na plán PRO a odemkněte všechny tyto úžasné funkce.','Address Autocomplete'=>'Automatické doplnění adresy','This message is only displayed to site administrators.'=>'Tato zpráva se zobrazuje pouze správcům webů.','A preview of your CAPTCHA is displayed below. Please view to verify the CAPTCHA settings are correct.'=>'Níže je zobrazen náhled vašeho CAPTCHA. Zkontrolujte prosím, zda jsou nastavení CAPTCHA správná.','This CAPTCHA is generated using your site and secret keys. If an error is displayed, please double-check your keys.'=>'Tato CAPTCHA je generována pomocí Vašeho webu a tajných klíčů. Pokud se zobrazí chyba, zkontrolujte prosím své klíče.','Please save settings to generate a preview of your CAPTCHA here.'=>'Prosím uložte nastavení, abyste zde vytvořili náhled svého CAPTCHA.','hCaptcha verification failed, please try again later.'=>'Ověření hCaptcha se nezdařilo, prosím opakujte akci znovu později.','Are you sure you want to disable %s for this form?'=>'Opravdu chcete zakázat %s pro tento formulář?','Custom Captcha'=>'Vlastní Captcha','CAPTCHA'=>'CAPTCHA','Connection missing.'=>'Spojení chybí.','Missing data.'=>'Chybějící data.','Your session expired. Please reload the page.'=>'Vaše relace vypršela. Prosím, obnovte stránku.','Copy embed code to clipboard'=>'Zkopírovat vložený kód do schránky','For more details on how hCaptcha works, as well as a step by step setup guide, please check out our <a href="%s" target="_blank" rel="noopener noreferrer">documentation</a>.'=>'Další podrobnosti o tom, jak hCaptcha funguje, a průvodce nastavením krok za krokem najdete v naší <a href="%s" target="_blank" rel="noopener noreferrer">dokumentaci</a>.','hCaptcha is a free and privacy-oriented spam prevention service. Within your forms, hCaptcha will display a checkbox asking users to prove they\'re human (much like Google\'s v2 Checkbox reCAPTCHA). This is a simple step for legitimate site visitors, but is extremely effective at blocking spam.'=>'hCaptcha je bezplatná služba pro prevenci proti spamu zaměřená na soukromí. Ve Vašich formulářích hCaptcha zobrazí zaškrtávací políčko s požadavkem, aby uživatelé prokázali, že jsou lidé (podobně jako Google v2 Checkbox reCAPTCHA). Jedná se o jednoduchý krok pro legitimní návštěvníky stránek, ale je velmi účinný při blokování spamu.','Vietnam'=>'Vietnam','Eswatini (Kingdom of)'=>'Svazijské království','Kosovo'=>'Kosovo','Google reCAPTCHA v2'=>'Google reCAPTCHA v2','%s verification failed, please try again later.'=>'%s Ověření selhalo, prosím opakujte akci znovu později.','Word Limit'=>'Maximální počet slov','Character Limit'=>'Maximální počet znaků','Disabling entry storage for this form will completely prevent any new submissions from getting saved to your site. If you still intend to keep a record of entries through notification emails, then please <a href="%s" target="_blank" rel="noopener noreferrer">test your form</a> to ensure emails send reliably.'=>'Zakázání vstupního úložiště pro tento formulář zcela zabrání uložení nových příspěvků na váš web. Pokud si stále chcete zaznamenávat záznamy prostřednictvím e-mailů s upozorněním, <a href="%s" target="_blank" rel="noopener noreferrer">otestujte svůj formulář</a>, abyste zajistili spolehlivé odesílání e-mailů.','Enable hCaptcha'=>'Povolit hCaptcha','Calculations, Form Abandonment, Conversational Forms, Lead Forms, Frontend Post Submission, User Registration, Geolocation, Google Sheets, Coupons, and more (30+ total)'=>'Výpočty, Opuštění formuláře, konverzační formuláře, odeslání příspěvku frontend, registrace uživatele, geolokace, tabulky Google, Kupóny a další (30+)','Calculations, Form Abandonment, Conversational Forms, Lead Forms, Frontend Post Submission, User Registration, Geolocation, Webhooks, Google Sheets, Coupons, and more (30+ total)'=>'Výpočty, Opuštění formuláře, Konverzační formuláře, Front-end odeslání příspěvku, Registrace uživatele, Geolokace, Webhook a další (celkem 30+)','Could not disconnect this account.'=>'Tento účet nelze odpojit.','For details, including how this looks and works for 