ected form.</a>'=>'Potřebujete provést změny? <a href="#">Upravit vybraný formulář.</a>','<b>You haven\'t created a form yet.</b><br> What are you waiting for?'=>'<b>Ještě jste nevytvořili formulář.</b><br> Na co čekáte?','Enable anti-spam protection'=>'Povolit ochranu proti spamu','Add Custom Value'=>'Přidat vlastní hodnotu','Your form contains unsaved changes. Would you like to save your changes first.'=>'Formulář obsahuje neuložené změny. Chcete uložit své změny jako první.','Save and Embed'=>'Uložit a vložit','Please fill out all blanks.'=>'Vyplňte prosím všechny mezery.','Input Mask Incomplete'=>'Vstupní maska ​​neúplná','%1$s These messages are displayed to the users as they fill out a form in real-time. Messages can include plain text and/or %2$sSmart Tags%3$s.'=>'%1$s Tyto zprávy se uživatelům zobrazují, když vyplňují formulář v reálném čase. Zprávy mohou obsahovat prostý text a/nebo %2$sChytré tagy%3$s.','Forcefully remove other CAPTCHA occurrences in order to prevent conflicts. Only enable this option if your site is having compatibility issues or instructed by support.'=>'Násilně odstraňte další výskyty CAPTCHA, abyste zabránili konfliktům. Tuto možnost povolte pouze v případě, že má web problémy s kompatibilitou, nebo na pokyn podpory.','Displays to users who fail the verification process.'=>'Zobrazí se uživatelům, kteří neuspějí v procesu ověření.','Choice %d'=>'Volba %d','Need some help? Check out our <a href="%s" target="_blank" rel="noopener noreferrer">comprehensive guide</a>.'=>'Potřebujete pomoc? Podívejte se na našeho <a href="%s" target="_blank" rel="noopener noreferrer">komplexního průvodce</a>.','You can use <b>WPForms</b> to build contact forms, surveys, payment forms, and more with just a few clicks.'=>'<b>WPForms</b> můžete použít k vytváření kontaktních formulářů, průzkumů, platebních formulářů a dalších pomocí několika kliknutí.','End Challenge'=>'Ukončit výzvu','Continue'=>'Pokračovat','Pause'=>'Pozastavit','Challenge Complete'=>'Výzva d