am s Constant Contact.','Drag and drop any field you want onto your signup form.'=>'2. Přetáhněte libovolné pole do přihlašovacího formuláře.','Select from our pre-built templates, or create a form from scratch.'=>'1. Vyberte si z našich před-vytvořených šablon nebo vytvořte formulář od nuly.','We made the form creation process extremely intuitive, so you can create a form to start capturing emails within 5 minutes or less.'=>'Proces vytváření formuláře jsme učinili velmi intuitivním, takže si můžete vytvořit formulář, který začne zaznamenávat e-maily během 5 minut nebo méně.','When creating WPForms, our goal was to make a WordPress forms plugin that\'s both EASY and POWERFUL.'=>'Při vytváření WPForms bylo naším cílem vytvořit plugin pro WordPress formuláře, který je SNADNÝ a VÝKONNÝ.','WPForms Makes List Building Easy'=>'WPForms usnadňuje vytváření seznamu','Try Constant Contact Today'=>'Vyzkoušejte Constant Contact ještě dnes','Get expert marketing and support'=>'Získejte odborný marketing a technickou podporu','Create and send professional email newsletters'=>'Vytvářejte a zasílejte profesionální e-mailové zpravodaje','Seamlessly add new contacts to your email list'=>'Snadno přidejte do seznamu e-mailů nové kontakty','But when you combine WPForms with Constant Contact, you can nurture your contacts and engage with them even after they leave your website. When you use Constant Contact + WPForms together, you can:'=>'Ale když zkombinujete WPForms s Constant Contact, můžete si udržovat své kontakty, i když opustili Váš web. Při společném používání Constant Contact + WPForms můžete:','WPForms plugin makes it fast and easy to capture all kinds of visitor information right from your WordPress site - even if you don\'t have a Constant Contact account.'=>'Plugin WPForms umožňuje rychlé a snadné zachycení všech druhů informací o návštěvnících přímo z Vašeho webu WordPress - i když nemáte účet s Constant Contact.','Get Started with Constant Contact for Free'=>'Začínáme s Constant Contact zdarma','With a powerful email marketing service like Constant Contact, you can instantly send out mass notifications and beautifully designed newsletters to engage your subscribers.'=>'Díky výkonné službě e-mailového marketingu, jako je Constant Contact, můžete okamžitě zasílat hromadná oznámení a krásné zpravodaje, abyste přilákali své předplatitele.','The Best Email Marketing Service'=>'Nejlepší e-mailová marketingová služba','High-Converting Form Builder'=>'Tvůrce formulářů s vysokou konverzí','A Website or Blog'=>'Web nebo blog','Here are the 3 things you need to build an email list:'=>'Zde jsou 3 věci, které potřebujete k vytvoření seznamu e-mailů:','For more details, see this guide on <a href="%s" target="_blank" rel="noopener noreferrer">why building your email list is so important</a>.'=>'Další podrobnosti naleznete v této příručce o tom, <a href="%s" target="_blank" rel="noopener noreferrer">proč je vytváření seznamu e-mailů tak důležité</a>.','That\'s why it\'s crucial to start collecting email addresses and building your list as soon as possible.'=>'Proto je velmi důležité začít sbírat e-mailové adresy a vytvářet seznam co nejdříve.','<strong>Email converts</strong> - People who buy products marketed through email spend 138% more than those who don\'t receive email offers.'=>'<strong>E-mailové konverze</strong> - Lidé, kteří nakupují produkty uváděné na trh prostřednictvím e-mailu, utratí o 138% více než ti, kteří nedostávají nabídky prostřednictvím e-mailu.','<strong>You own your email list</strong> - Unlike with social media, your list is your property and no one can revoke your access to it.'=>'<strong>Vlastníte seznam e-mailů</strong> - Na rozdíl od sociálních médií je Váš seznam Váš majetek a nikdo Vám nemůže zrušit přístup k němu.','<strong>Email is still #1</strong> - At least 91% of consumers check their email on a daily basis. You get direct access to your subscribers, without having to play by social media\'s rules and algorithms.'=>'<strong>E-mail je stále #1</strong> - Alespoň 91% spotřebitelů denně kontroluje svůj e-mail. Získáte přímý přístup k předplatitelům, aniž byste museli hrát podle pravidel a algoritmů sociálních médií.','Here are 3 big reasons why every smart business in the world has an email list:'=>'Zde jsou 3 důvody, proč má každý chytrý podnik na světě seznam e-mailů:','Email is hands-down the most effective way to nurture leads and turn them into customers, with a return on investment (ROI) of <strong>$44 back for every $1 spent</strong> according to DMA.'=>'E-mail je bezpochyby nejefektivnějším způsobem, jak převést potenciální zákazníky na stálé zákazníky, s návratností investice (ROI) ve výši <strong>44$ zpět za každý utracený 1$</strong>, podle DMA.','Wondering if email marketing is really worth your time?'=>'Zajímá Vás, jestli e-mailový marketing opravdu stojí za Váš čas?','Grow Your Website with WPForms + Email Marketing'=>'Rozšiřte web pomocí WPForms + e-mailový marketing','Learn More about the <a href="%s">power of email marketing</a>'=>'Další informace o <a href="%s">síle e-mailového marketingu</a>','Connect your existing account'=>'Připojit existující účet:','Get the most out of the <strong>WPForms</strong> plugin &mdash; use it with an active Constant Contact account.'=>'Získejte maximum z pluginu <strong>WPForms</strong> - použijte jej s aktivním účtem Constant Contact.','Try Constant Contact for Free'=>'Vyzkoušejte Constant Contact zdarma','Connect'=>'Připojit','Account Nickname'=>'Přezdívka účtu','Authorization Code'=>'Autorizační kód','Click here to register with Constant Contact'=>'Klikněte zde a zaregistrujte se u Constant Contact','Because Constant Contact requires external authentication, you will need to register WPForms with Constant Contact before you can proceed.'=>'Protože Constant Contact vyžaduje externí autentizaci, budete muset zaregistrovat WPForms u Constant Contact, než budete moci pokračovat.','Click here for documentation on connecting WPF