erou musíte udělat, je nainstalovat WPForms. Jakmile to uděláte, půjdeme se podívat na proces aktivace doplňků.','How to Install and Activate WPForms Addons'=>'Jak nainstalovat a aktivovat doplňky WPForms','Do you need to check that your forms are compliant with the European Union’s General Data Protection Regulation? The best way to ensure GDPR compliance for your specific site is always to consult legal counsel. In this guide, we’ll discuss general considerations for GDPR compliance in your WordPress forms.'=>'Potřebujete zkontrolovat, zda jsou formuláře v souladu s obecným nařízením Evropské unie o ochraně údajů? Nejlepším způsobem, jak zajistit splnění GDPR pro konkrétní web, je vždy konzultovat právní radu. V této příručce budeme diskutovat o obecných úvahách o dodržování GDPR ve formulářích WordPress.','How to Create GDPR Compliant Forms'=>'Jak vytvořit formuláře kompatibilní s GDPR','Would you like to learn more about all of the settings available in WPForms? In addition to tons of customization options within the form builder, WPForms has an extensive list of plugin-wide options available. This includes choosing your currency, adding GDPR enhancements, setting up integrations.'=>'Chtěli byste se dozvědět více o všech nastaveních dostupných ve WPForms? Kromě množství možností přizpůsobení v rámci nástroje pro tvorbu formulářů má WPForms k dispozici také rozsáhlý seznam možností pro celý plugin. To zahrnuje výběr měny, přidání vylepšení GDPR, nastavení integrace.','A Complete Guide to WPForms Settings'=>'Kompletní průvodce nastavením WPForms','Read Documentation'=>'Přečtěte si dokumentaci','Are you wondering which form fields you have access to in WPForms and what each field does? WPForms has lots of field types to make creating and filling out forms easy. In this tutorial, we’ll cover all of the fields available in WPForms.'=>'Zajímá vás, k jakým polím formuláře máte přístup ve WPForms a co každé pole dělá? WPForms má mnoho typů polí, které usnadňují vytváření a vyplňování formulářů. V tomto tutoriálu se budeme zabývat všemi poli, která jsou k dispozici ve WPForms.','How to Choose the Right Form Field'=>'Jak zvolit správné pole formuláře','Bonus: WPForms Lite users get <span class="price-20-off">50% off regular price</span>, automatically applied at checkout.'=>'Bonus: Uživatelé WPForms Lite dostanou <span class="price-20-off">50% slevu z běžné ceny</span>, která bude automaticky použita na pokladně!','Get WPForms Pro Today and Unlock all the Powerful Features'=>'Získejte WPForms Pro ještě dnes a odemkněte všechny výkonné funkce','We know that you will truly love WPForms. It has over <strong>13,000+ five star ratings</strong> (%s) and is active on over 6 million websites.'=>'Víme, že budete WPForms opravdu milovat. Má více než <strong>13 000+ pětihvězdičkových hodnocení</strong> (%s) a je aktivní na více než 6 milionech webů.','Thanks for being a loyal WPForms Lite user. <strong>Upgrade to WPForms Pro</strong> to unlock all the awesome features and experience<br>why WPForms is consistently rated the best WordPress form builder.'=>'Děkujeme, že jste loajální uživatel WPForms Lite. <strong>Upgradujte na WPForms Pro</strong> a odemkněte všechny úžasné funkce a zažijte,<br> proč je WPForms trvale hodnocen jako nejlepší tvůrce WordPress formulářů.','How to Display Forms on Your Site'=>'Jak zobrazit formuláře na webu','How to Customize Form Fields'=>'Jak přizpůsobit pole formuláře','How to Add a New Form'=>'Jak vytvořit nový formulář','In the Forms Overview page, the forms list will be empty because there are no forms yet. To create a new form, click on the Add New button, and this will launch the WPForms Form Builder.'=>'Na stránce Přehled formulářů bude seznam formulářů prázdný, protože zatím žádné formuláře neexistují. Chcete-li vytvořit nový formulář, klikněte na tlačítko Vytvořit nový a tím se spustí Tvůrce formulářů WPForms.','To begin, you’ll need to be logged into the WordPress admin area. Once there, click on WPForms in the admin sidebar to go to the Forms Overview page.'=>'Nejprve musíte být přihlášeni do administrátorské oblasti WordPress. Poté klikněte na WPForms na postranním panelu administrátora a přejděte na stránku Přehled formulářů.','Want to get started creating your first form with WPForms? By following the step by step instructions in this walkthrough, you can easily publish your first form on your site.'=>'Chcete začít vytvářet svůj první formulář s WPForms? Podle pokynů krok za krokem v tomto návodu můžete snadno publikovat svůj první formulář na webu.','Creating Your First Form'=>'Vytvoření prvního formuláře','Status: %s'=>'Stav: %s','Install Plugin'=>'Nainstalovat plugin','The WPForms Team photo'=>'Fotografie týmu WPForms','Yup, we know a thing or two about building awesome products that customers love.'=>'Jo, víme něco o vytváření úžasných produktů, které zákazníci milují.','WPForms is brought to you by the same team that’s behind the largest WordPress resource site, <a href="%1$s" target="_blank" rel="noopener noreferrer">WPBeginner</a>, the most popular lead-generation software, <a href="%2$s" target="_blank" rel="noopener noreferrer">OptinMonster</a>, the best WordPress analytics plugin, <a href="%3$s" target="_blank" rel="noopener noreferrer">MonsterInsights</a>, and more!'=>'WPForms Vám přináší stejný tým, který stojí za největším zdrojem zdrojů WordPress, <a href="%1$s" target="_blank" rel="noopener noreferrer">WPBeginner</a>, nejoblíbenějším vedoucím – generační software, <a href="%2$s" target="_blank" rel="noopener noreferrer">OptinMonster</a>, nejlepší analytický plugin WordPress, <a href="%3$s" target="_blank" rel="noopener noreferrer">MonsterInsights</a> a další!','Our goal is to take the pain out of creating online forms and make it easy.'=>'Naším cílem je učinit vytváření online formulářů bezbolestným a snadným.','Over the years, we found that most WordPress contact form plugins were bloated, buggy, slow, and very hard to use. So we started with a simple goal: build a WordPress forms plugin that’s both easy and powerful.'=>'V průběhu let jsme zjistili, že většina pluginů pro kontaktní formulář WordPress byla nafouklá, zabugovaná, pomalá a velmi obtížně použitelná. Začali jsme tedy s jednoduchým cílem: vytvořit plugin pro formuláře WordPress, který je jednoduchý a výkonný.','Hello and welcome to WPForms, the most beginner friendly drag & drop WordPress forms plugin. At WPForms, we build software that helps you create beautiful responsive online forms for your website in minutes.'=>'Dobrý den, vítejte u WPForms, formulářový plugin pro WordPress, který je nejvhodnější pro začátečníky. Ve WPForms vyvíjíme software, který Vám pomůže vytvořit krásné, responzivní, online formuláře, pro Váš web, během několika minut.','Getting Started'=>'Začínáme','Advanced Form Features'=>'Pokročilé funkce formuláře','Surveys & Polls'=>'Průzkumy & Ankety','Payment Forms'=>'Platební formuláře','Marketing Integrations'=>'Marketingové integrace','Form Fields'=>'Pole formuláře','Addon installed.'=>'Doplněk byl nainstalován.','Plugin installed.'=>'Plugin byl nainstalován.','Addon installed & activated.'=>'Doplněk nainstalován & aktivován.','Plugin installed & activated.'=>'Plugin nainstalován & aktivován.','Could not activate the addon. Please activate it on the Plugins page.'=>'Doplněk nelze aktivovat. Prosím, aktivujte ho na stránce Pluginy.','Addon activated.'=>'Doplněk byl aktivován.','Plugin activated.'=>'Plugin byl aktivován.','Could not deactivate the addon. Please deactivate from the Plugins page.'=>'Doplněk nelze deaktivovat. Deaktivujte ho prosím na stránce Pluginy.','Addon deactivated.'=>'Doplněk byl deaktivován.','Plugin deactivated.'=>'Plugin byl deaktivován.','There was an error and the connection failed. Please contact your web host with the technical details below.'=>'Došlo k chybě a připojení se nezdařilo. Kontaktujte svého webového hostitele s níže uvedenými technickými údaji.','Success! Your server can make SSL connections.'=>'Úspěch! Server může navázat spojení SSL.','No Form ID Provided'=>'Nebylo zadáno žádné ID Formuláře','Error Creating Form'=>'Při vytváření Formuláře došlo k chybě','No Form Name Provided'=>'Nebyl zadán žádný název Formuláře','About Us'=>'O nás','About WPForms'=>'O WPForms','Addons'=>'Doplňky','Info'=>'Info','Tools'=>'Nástroje','WPForms Tools'=>'WPForms Nástroje','WPForms Settings'=>'WPForms Nastavení','Form Entries'=>'Záznamy formuláře','WPForms Builder'=>'Editor WPForms','All Forms'=>'Všechny formuláře','Enable Google Invisible v2 reCAPTCHA'=>'Povolit Google Neviditelná v2 reCAPTCHA','Enable anti-spam honeypot'=>'Povolit anti-spam honeypot','Enter CSS class names for the form submit button. Multiple names should be separated with spaces.'=>'Zadejte názvy tříd CSS pro tlačítko k odeslání formuláře. Více jmen by mělo být odděleno mezerami.','Submit Button CSS Class'=>'CSS třída tlačítka Odeslat','Enter the submit button text you would like the button display while the form submit is processing.'=>'Zadejte text tlačítka odeslat, který se má zobrazit během odesílání formuláře.','Submit Button Processing Text'=>'Text tlačítka Odeslat během zpracování','Submit Button Text'=>'Text tlačítka Odeslat','Enter CSS class names for the form wrapper. Multiple class names should be separated with spaces.'=>'Zadejte názvy tříd CSS pro obálku formuláře. Více jmen by mělo být odděleno mezerami.','Form CSS Class'=>'CSS třída formuláře','Form Description'=>'Popis formuláře','You need to <a href="#" class="wpforms-panel-switch" data-panel="setup">setup your form</a> before you can manage the settings.'=>'Musíte <a href="#" class="wpforms-panel-switch" data-panel="setup">nastavit formulář</a> než budete moci tato nastavení spravovat.','General'=>'Obecné','Settings'=>'Nastavení','Analytics'=>'Analytika','It seems you do not have any payment addons activated. You can head over to the <a href="%s">Addons page</a> to install and activate the addon for your payment service.'=>'Zdá se,