itted due to compatibility issues.'=>'Můžete pokračovat v importu bez upgradu a my se budeme snažit, aby pole odpovídala. Některé z nich však budou kvůli problémům s kompatibilitou vynechány.','One or more of your forms contain fields that are not available in WPForms Lite. To properly import these fields, we recommend upgrading to WPForms Pro.'=>'Jeden nebo více formulářů obsahuje pole, která nejsou dostupná ve WPForms Lite. Chcete-li tato pole správně importovat, doporučujeme upgradovat na WPForms Pro.','Heads Up!'=>'Pozor!','Forms to Import'=>'Formuláře k importu','Select All'=>'Vybrat vše','No forms found.'=>'Nebyly nalezeny žádné formuláře.','Available Forms'=>'Dostupné formuláře','Select the forms you would like to import.'=>'Vyberte formuláře, které chcete importovat.','Form Import'=>'Import formuláře','Not Active'=>'Neaktivní','Not Installed'=>'Není nainstalován','Select previous contact form plugin...'=>'Vyberte předchozí plugin pro kontaktní formulář...','No form importers are currently enabled.'=>'V současné době nejsou povoleny žádné importovací nástroje pro formulář.','WPForms makes it easy for you to switch by allowing you import your third-party forms with a single click.'=>'WPForms usnadňuje přepínání tím, že umožňuje importovat formuláře třetích stran jediným kliknutím.','Not happy with other WordPress contact form plugins?'=>'Nejste spokojeni s jinými pluginy pro kontaktní formuláře pro WordPress?','Import from Other Form Plugins'=>'Import z jiného formulářového pluginu','No file chosen'=>'Nebyl vybrán žádný soubor','files selected'=>'vybrané soubory','Select a WPForms export file.'=>'Vyberte exportní soubor WPForms.','WPForms Import'=>'Import WPForms','System Info'=>'Systémová informace','Export'=>'Export','Import'=>'Import','There was an error while creating a new form.'=>'Při vytváření nového formuláře došlo k chybě.','%1$s Field %2$s'=>'%1$s pole %2$s','Notification 2'=>'Oznámení 2','Acceptance Field'=>'Pole přijetí','The form you are trying to